import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Link } from 'react-router-dom';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  appBar: {
    backgroundColor: '#fff', // Customize the background color
    [theme.breakpoints.up('md')]: {
      // Apply styles only for medium screens and above
      paddingLeft: theme.spacing(4),
      paddingRight: theme.spacing(4),
    },
  },
  title: {
    flexGrow: 1,
    color: '#000', // Customize the title color
    textDecoration: 'none', // Remove the default underline style
  },
  navLink: {
    color: '#000', // Customize the link color
    textDecoration: 'none', // Remove the default underline style
    marginLeft: theme.spacing(2),
    [theme.breakpoints.up('md')]: {
      marginLeft: theme.spacing(4),
    },
  },
}));

export default function NavBar() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <AppBar position="static" className={classes.appBar}>
        <Toolbar>
          <Typography variant="h6" component={Link} to="/" className={classes.title}>
            Home
          </Typography>
          <Typography variant="h6" component={Link} to="/About" className={classes.navLink}>
            About
          </Typography>
          <Typography variant="h6" component={Link} to="/Contact" className={classes.navLink}>
            Contact
          </Typography>
        </Toolbar>
      </AppBar>
    </div>
  );
}
